import axios from "axios";
import React from "react";
class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = { resultado: {}, evento: {}, ready: false };
  }

  changeHandler = (e) => {
    const el = e.target;
    this.setState({
      [el.name]: el.type === "file" ? el.files[0] : el.value,
    });
  };

  submitImg = (e) => {
    e.preventDefault();

    const bodyFormData = new FormData(e.target);
    this.setState({ evento: bodyFormData });
    //
    return axios
      .post("http://127.0.0.1:8000/detectar-objeto", bodyFormData)
      .then((result) => {
        this.guardarData(result);
      })
      .catch((error) => {
        console.log("la cagamos");
      });
  };

  /*async mandaleAxios(lacosa) {
    await axios
      .post("http://127.0.0.1:8000/detectar-objeto", lacosa)
      .then((result) => {
        this.guardarData(result);
      })
      .catch((error) => {
        console.log("la cagamos");
      });
  }*/

  guardarData(result) {
    this.setState({ resultado: result }, () => {
      console.log(this.state);
    });
    this.setState({ ready: true });
  }

  render() {
    return (
      <body>
        <h2>Detectar Objeto</h2>

        <form
          onSubmit={this.submitImg}
          encType="multipart/form-data"
          onChange={(e) => this.changeHandler(e)}
        >
          <input type="file" name="img1" />
          <button type="submit">Submit</button>
        </form>
        {this.state.ready === true && (
          <React.Fragment>
            <h2> resultado: </h2>
            <p> Elemento detectado: {this.state.resultado.data.detectado}</p>
            <p>
              {" "}
              Porcentaje de eficiencia: {this.state.resultado.data.porcentaje}
            </p>
          </React.Fragment>
        )}
      </body>
    );
  }
}
export default Home;
